import ExpenseForm from "../expense-form/expenseForm"
import Button from "../UI/Batton"
const NewExpense=()=>{
return(
    <div style={{width:'400px',height:'200px', border:'1px solid ' }}>
     <Button title='Добавить новый расход'/>
     <ExpenseForm/>
    </div>
)
}
export default NewExpense
